    "2016-07-27T22:44:30.617446",nt"name": "southeast-region-refuges-service-catalog-implementation-strategy-and-document-selection-gu",nt"isopen":
    false,nt"url": null,nt"notes": "Implementation strategy and document selection
    guide for the FWS Service Catalog (ServCat) on Southeast Region National Wildlife
    Refuges. The recommended R4 ServCat strategy relies extensively on primary legacy
    documentation retrieval and archive in ServCat using seasonal interns (i.e., volunteer
    interns, Pathways, Student Conservation Association) with oversight and contribution
    by I&M staff members working on targeted refuges. ServCat legacy document archival
    will first target refuges at high-risk for permanent loss, particularly vulnerable
    coastal refuges, u201chomeu201d refuges of I&M staff, and refuges eager to participate
    in document archiving. Documents targeted include refuge annual narratives, management
    plans, information related to water resources, unpublished biological reports (i.e.,
    gray-literature), and documents prioritized by refuge staff.",nt"license_title":
